import { Card, Col, Row } from "react-bootstrap";

const PortraitCard = () => {
    return (
        <Card>
                        <Card.Img variant="top" src="art.jpg" />
                        <Card.Body>
                            <Card.Title>Card title</Card.Title>
                            <Card.Text>Lorem Epsum
                            </Card.Text>
                        </Card.Body>
                    </Card>
    );
}

export default PortraitCard
